import '../../assets/css/Home.css';


const home = (props) => {
    return (
        <div className='main'>

            <div style={{ "fontSize": "90px" }} className="font-link">
                Ready For Some Laughs And Intergalactic Fun!!
            </div>

            <br />
        </div>
    )
}

export default home;
